} use crate::List::{Cons,Nil};
enum List { Cons(i32,Box<List>), Nil,
} 链表b和c共享了a链表,编译时会报错: --> src\main.rs:4:9 |
4 | let c=Cons(10, Box::new(a)); | - move occurs because `a` has type `List`, which does not implement the `Copy` trait
3 | let b=Cons(3, Box::new(a)); | - value moved here
4 | let c=Cons(10, Box::new(a)); | 因为在b声明后，b持有了a的所有权.此后再尝试声明c并且让c也持有a的所有权,这时的a所有权不在a上,而是在b上。 使用Rc::clone来声明b: Rc::clone()不是深度拷贝,只是浅度拷贝,即只增加堆上对应数据的引用次数. use std::rc::Rc;
fn main() { let a=Rc::new(Cons(5,Rc::new(Cons(2,Rc::new(Nil))))); let b=Cons(3, Rc::clone(&a)); let c=Cons(10, Rc::clone(&a)); println!("b is {:?}",b); println!("c is {:?}",c);
} use crate::List::{Cons,Nil};
#[derive(Debug)]
enum List { Cons(i32,Rc<List>), Nil,
}
